If you have any questions about the contract terms or need any clarification, please don''t hesitate to contact me.

The contract can be signed digitally via the link I sent, or you can print, sign, and return it by email.

Thank you for your attention to this matter.

Best regards,
[Your Name]
[Your Business Name]
[Contact Details]', 'Hi [Client Name], just a reminder that your contract for [Date] is awaiting signature. Link: [Contract Link]. Any questions? - [Your Name]', false, 'general');
INSERT INTO public.email_templates VALUES (8, '43963086', 'Invoice Reminder', 'Invoice payment reminder', false, '2025-07-17 21:53:02.999101', '2025-07-17 21:53:02.999101', 'Dear [Client Name],

