[Payment Details]

If you have any questions about the invoice or if there are any issues with payment, please don''t hesitate to contact me.

Thank you for your prompt attention to this matter.

Best regards,
[Your Name]
[Your Business Name]
[Contact Details]', 'Hi [Client Name], friendly reminder that invoice [Invoice Number] for [Amount] was due on [Due Date]. Payment details: [Payment Info]. Thanks! - [Your Name]', false, 'general');
