I look forward to hearing from you soon.

Best regards,
[Your Name]
[Your Business Name]
[Contact Details]', 'Hi [Client Name], following up on the quote for your event on [Date]. Any questions or ready to book? Let me know! - [Your Name]', false, 'general');
INSERT INTO public.email_templates VALUES (369, '_PPMWoh-sThHqS3pfrCwm', 'Contract Reminder', 'Contract awaiting signature', false, '2025-08-26 19:42:13.979', '2025-08-26 19:42:13.979', 'Dear [Client Name],

