INSERT INTO public.email_templates VALUES (751, 'yvzV7ZJhq_ZMoGCaiC_h6', 'Enquiry Response - Available', 'Re: Your Music Enquiry', true, '2025-09-07 21:15:58.521', '2025-09-07 21:15:58.521', 'Dear [Client Name],

