INSERT INTO public.unparseable_messages VALUES (93, '1754488522516', 'email', 'timfulkermusic+caf_=timfulkermusic=enquiries.musobuddy.com@gmail.com', '** New: Customers can now select your Packages & Add-ons in Direct Enquiries
------------------------------------------------------------

Packages & Add-ons are now selectable in Direct Enquiries

Hi Tim,

Im excited to let you know about our latest upgrade to the Direct Enquiry form.


** What''s changed
------------------------------------------------------------
When a client sends you a Direct Enquiry, they can now select Packages and Add-ons directly from your profiles Price Guide.

Until now, clients could only select your Standard prices when sending a Direct Enquiry.

Update my Price Guides (https://encoremusicians.com/dashboard)


** Why we made this change
------------------------------------------------------------
This update is the latest in a series of improvements were making to Direct Enquiries, all designed to make it easier for you to quote and get bookings on Encore.

Our research shows that your chances of getting booked increase when displaying your pricing clearly on your profile, including Packages and Add-Ons.

This is because youre attracting clients who already know they can afford your services and are much more likely to book!
From today, clients will be able to:
* Combine a Standard price with one (or more) of your Add-ons
* Select one of your Packages


This makes it easier for customers to choose the right options to fit their budget and requirements before they get in touch, and send you high-quality enquiries that are easier for you to respond to.


** What you need to do
------------------------------------------------------------
If youve already created Packages in your profile, youll need to set a performance duration for each Package to make it selectable on the enquiry form. This takes ~10 seconds per Package. Heres how to do it:
1. Go to your Profile (https://encoremusicians.com/dashboard)  Price guides  Packages
2. Click Edit
3. Select a Performance duration and confirm with Update

Update my Packages (https://encoremusicians.com/dashboard)
If you havent added any Packages or Add-ons yet, nows the perfect time to do so!

These let you showcase tailored packages for different line-ups, event types, or any extras you can provide - for example, full-day wedding packages, weekday pub gigs, holiday specials, a with PA vs. without PA option, PA hire, or additional music.

The more tailored your offerings, the more likely a client will spot the perfect fit for their event.

Heres how you can list your Packages and Add-ons:
1. Go to your Profile (https://encoremusicians.com/dashboard)  Price guides  Packages  Add package  Create
2. Go to your Profile (https://encoremusicians.com/dashboard)  Price guides  Add-ons  Create add-on  Create

Add Packages & Add-ons (https://encoremusicians.com/dashboard)
To increase your chances of booking gigs, we recommend taking a moment to review your Price Guides too, to ensure the pricing information on your profile is accurate and up-to-date.

Pro tip: when you complete your Price Guides, your profile will also receive a boost in search rankings!

Review my Price Guides (https://encoremusicians.com/dashboard)
Please note: on Encore, adding prices does not mean you are committing to charging those exact rates when a customer gets in touch, as things such as travel costs or equipment requirements may impact your pricing for each event. Thats why you always provide a tailored quote for every customer. But keeping your prices up to date and as close as possible to a real quote can go a long way towards securing more bookings!
If you need any help updating your existing Packages, adding new ones, or reviewing your Price Guides, or if you have any feedback you want to share with us, just reply to this email or message us at help@encoremusicians.com (mailto:help@encoremusicians.com) and our team will be more than happy to help.
Happy gigging,

Giulio
Encore
he/him/his
help@encoremusicians.com (mailto:help@encoremusicians.com)

